import React from 'react';
import { Routes, Route, Link, Navigate, useNavigate } from 'react-router-dom';
import { useEffect } from 'react';
import { getAuthToken, decodeToken } from './api/endpoint';
import Login from './auth/Login';
import PatientDashboard from './pages/PatientDashboard';

// Navbar SIMPLE (SANS react-icons)
const Navbar = () => {
  const navigate = useNavigate();
  const token = getAuthToken();
  const userRole = token ? decodeToken(token)?.role : null;

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/login');
  };

  return (
    <nav className="bg-white shadow-lg border-b-2 border-blue-100 sticky top-0 z-50">
      <div className="max-w-6xl mx-auto px-6 py-4">
        <div className="flex items-center justify-between">
          {/* Logo */}
          <Link to={token ? `/${userRole?.toLowerCase()}` : '/'} className="flex items-center space-x-2">
            <div className="w-10 h-10 bg-gradient-to-r from-blue-500 to-purple-600 rounded-2xl flex items-center justify-center">
              <span className="text-2xl font-bold text-white">GM</span>
            </div>
            <span className="text-2xl font-bold bg-gradient-to-r from-blue-600 to-purple-600 bg-clip-text text-transparent">
              GOVAIMED
            </span>
          </Link>

          {/* Menu */}
          {token ? (
            <div className="flex items-center space-x-6">
              <Link to="/patient" className="text-lg font-semibold text-gray-700 hover:text-blue-600 transition-colors">
                Dashboard
              </Link>
              <button
                onClick={handleLogout}
                className="px-6 py-2 bg-red-500 text-white font-semibold rounded-xl hover:bg-red-600 transition-all shadow-md"
              >
                Déconnexion
              </button>
            </div>
          ) : (
            <Link
              to="/login"
              className="px-8 py-3 bg-blue-600 text-white font-bold rounded-xl hover:bg-blue-700 transition-all shadow-lg"
            >
              Connexion
            </Link>
          )}
        </div>
      </div>
    </nav>
  );
};

// Page d'accueil
const Home = () => (
  <div className="min-h-screen bg-gradient-to-br from-blue-50 to-indigo-100 py-20 px-6">
    <div className="max-w-4xl mx-auto text-center">
      <h1 className="text-5xl md:text-6xl font-bold bg-gradient-to-r from-blue-600 via-purple-600 to-indigo-600 bg-clip-text text-transparent mb-8">
        GOVAIMED
      </h1>
      <p className="text-xl md:text-2xl text-gray-700 mb-12 max-w-2xl mx-auto leading-relaxed">
        Plateforme médicale innovante pour une santé accessible à tous
      </p>
      <div className="space-x-4">
        <Link
          to="/login"
          className="inline-block px-10 py-4 bg-blue-600 text-white text-xl font-bold rounded-2xl hover:bg-blue-700 transition-all shadow-xl hover:shadow-2xl transform hover:-translate-y-1"
        >
          Se connecter
        </Link>
        <Link
          to="/register"
          className="inline-block px-10 py-4 border-2 border-purple-500 text-purple-600 text-xl font-bold rounded-2xl hover:bg-purple-50 transition-all hover:shadow-lg"
        >
          S'inscrire
        </Link>
      </div>
    </div>
  </div>
);

function App() {
  return (
    <div className="min-h-screen flex flex-col bg-gray-50">
      {/* Navbar TOUJOURS présente */}
      <Navbar />

      {/* Contenu principal */}
      <main className="flex-1">
        <Routes>
          {/* Pages publiques */}
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Login />} /> {/* Temporaire */}

          {/* Dashboards privés */}
          <Route path="/patient/*" element={<PatientDashboard />} />

          {/* Redirection */}
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </main>

      {/* Footer simple */}
      <footer className="bg-gray-900 text-white py-8 mt-20 border-t-2 border-gray-800">
        <div className="max-w-6xl mx-auto px-6 text-center">
          <p className="text-lg font-semibold mb-2">© 2026 GOVAIMED</p>
          <p className="text-gray-400">Plateforme médicale innovante</p>
        </div>
      </footer>
    </div>
  );
}

export default App;
